import React,{Component} from 'react';
import {gql} from 'apollo-boost';

import {graphql} from 'react-apollo';

const getBookQuery =gql`
{
    books{
        name
        id
    }
}
`

class Booklist extends Component{
    render(){
        return(
        <div>
            <ul id="book-list"> 
                <li> book name </li>
            </ul>
        </div>
        );
    }
}

export default graphql(getBookQuery)(Booklist);
